import Home from './pages/Home'
import fhirDepartment1 from '../src/pix/fhir1.jpg'

const img1 = useRef()

useEffect(_ => {
  setTimeout(_ => {
    img1.current.style.height = '0px'
    setTimeout(_ => img1.current.style.display = 'none', 1005)
  }, 1000)
}, [])

const App = _ => {
  return (
    <>
      <img ref={img1} src={fhirDepartment1} alt='FHIR department' />
      <Home />
    </>
  )
}

export default App
